export const NoRoom = () => {
  return (
    <div
      style={{
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -50%)",
      }}
    >
      <img alt="logo" width={550} height={450} src={DecentioLogo}></img>
      <h3>You have no selected room</h3>
    </div>
  );
};
